import React from "react";

export default function Projects() {
  const projects = [
    { name: "Portfolio Website", desc: "A personal portfolio in React" },
    { name: "E-commerce App", desc: "React + Node.js + MongoDB full stack app" },
  ];

  return (
    <section id="projects" className="p-5 bg-white dark:bg-gray-800 text-gray-900 dark:text-white">
      <h2 className="text-3xl font-bold mb-4">Projects</h2>
      <div className="space-y-4">
        {projects.map((p, i) => (
          <div
            key={i}
            className="p-4 border border-gray-300 dark:border-gray-600 rounded-lg bg-gray-50 dark:bg-gray-700"
          >
            <h3 className="text-xl font-semibold mb-2">{p.name}</h3>
            <p className="text-gray-700 dark:text-gray-300">{p.desc}</p>
          </div>
        ))}
      </div>
    </section>
  );
}
